import * as React from "react";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import { Cols, PurchaseButton, Rows } from "./types";
import { Button } from "@mui/material";

const columns: Cols[] = [
  { id: "img", label: "Ïù¥ÎØ∏ÏßÄ", minWidth: 120 },
  { id: "name", label: "ÏÉÅÌíàÎ™Ö", minWidth: 120 },
  { id: "price", label: "Í∞ÄÍ≤©", minWidth: 170 },
  { id: "button", label: "Íµ¨Îß§ÌïòÍ∏∞", minWidth: 170 },
];

const purchaseButton = ({ ispurchased }: PurchaseButton) => {
  return (
    <Button
      style={{
        backgroundColor: ispurchased ? "#CFCFCF" : "#FF7474",
        color: "#FFF",
        fontWeight: 800,
      }}
      onClick={ispurchased ? block : () => alert("ÏÉÅÌíàÏùÑ Íµ¨Îß§ÌïòÏòÄÏäµÎãàÎã§.")}
    >
      ÏÉÅÌíà Íµ¨Îß§ÌïòÍ∏∞
    </Button>
  );
};

const rows: Rows[] = [
  {
    img: "üçî",
    name: "ÏÉÅÌíàA",
    price: 3000,
    button: purchaseButton({ ispurchased: false }),
  },
  {
    img: "‚öΩ",
    name: "ÏÉÅÌíàB",
    price: 10000,
    button: purchaseButton({ ispurchased: false }),
  },
  {
    img: "üß¢",
    name: "ÏÉÅÌíàC",
    price: 15000,
    button: purchaseButton({ ispurchased: false }),
  },
  {
    img: "üíº",
    name: "ÏÉÅÌíàD",
    price: 40000,
    button: purchaseButton({ ispurchased: true }),
  },
];

const InfoTable = () => {
  return (
    <Paper sx={{ width: "100%", overflow: "hidden" }}>
      <TableContainer>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  style={{ minWidth: column.minWidth }}
                  align="center"
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => {
              return (
                <TableRow
                  hover
                  role="checkbox"
                  tabIndex={-1}
                  style={{ height: "10px" }}
                >
                  <TableCell align={"center"}>{row["img"]}</TableCell>
                  <TableCell align={"center"}>{row["name"]}</TableCell>
                  <TableCell align={"center"}>{row["price"]}</TableCell>
                  <TableCell align={"center"}>{row["button"]}</TableCell>
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default InfoTable;
